import{_ as a,c as e,o,U as t}from"./chunks/framework.D62e7L7j.js";const f=JSON.parse('{"title":"同程旅行","description":"","frontmatter":{},"headers":[],"relativePath":"work/tc-travel/index.md","filePath":"work/tc-travel/index.md","lastUpdated":1725034049000}'),r={name:"work/tc-travel/index.md"},d=t('<h1 id="同程旅行" tabindex="-1">同程旅行 <a class="header-anchor" href="#同程旅行" aria-label="Permalink to &quot;同程旅行&quot;">​</a></h1><p>工作时间：<code>218-12-12</code> 至 <code>2021-07-23</code></p><h2 id="离开" tabindex="-1">离开 <a class="header-anchor" href="#离开" aria-label="Permalink to &quot;离开&quot;">​</a></h2><p>从实习开始已经在同程待了两年半了，加上和女朋友异地恋很久了，两人也很早就约定好了集合，所以是时候离开了。找工作跳槽的这几个月来确实非常辛苦，压力也很大，从最开始的失败到后面通过了越来越多的面试，自信心也得到了很大的提升，最后也如愿拿到了鹅厂的 <code>offer</code>，也完成了大叔对我的期望。在同程的两年半以来，非常感谢大叔对我的栽培，不知道以后的领导是啥样的。感谢组里同事对我的照顾。苏州这个城市个人还是非常喜欢的，压力不是很大，生活气息浓，大家工作也很努力，但不卷，也结识了很多朋友，工牌上交江湖再见。从懵懂无知踏入职场，到收获满满从同程毕业，开启下一段旅程。</p><h2 id="成长" tabindex="-1">成长 <a class="header-anchor" href="#成长" aria-label="Permalink to &quot;成长&quot;">​</a></h2><p><code>2020</code> 年经历了巨大的成长，负责了越来越多的复杂更多复杂的功能模块，也加入了 <code>lowcode</code> 平台的开发。自己主导和负责的的 <code>siskin</code> 组件库也持续的在更新迭代维护，大叔也挺认可我，带我参加了越来越多重要的项目。个人经历也多了，更加沉稳了，内心也更加强大了，每一年都是不一样的的，每一年自己的能力都有很大的提升，让自己成为一个更靠谱的人。总之还是很不错的，对自己也挺满意的。不过小倪也快毕业了，可能得面临结束异地恋了。</p><h2 id="疫情" tabindex="-1">疫情 <a class="header-anchor" href="#疫情" aria-label="Permalink to &quot;疫情&quot;">​</a></h2><p>突如其来的疫情冲击着旅游行业，大家都很恐慌，也有很多人被裁员了，原本10个人的原生开发小组被裁员到只剩下两个人，大家都害怕被裁。疫情打乱了大家的生活和工作节奏，坚持住一切会慢慢好起来。</p><h2 id="突破口" tabindex="-1">突破口 <a class="header-anchor" href="#突破口" aria-label="Permalink to &quot;突破口&quot;">​</a></h2><p>组件库确实成为了我的突破口，也让我找到了乐趣，花了很多时间去钻研组件库如何变得更好，组件库版本上线以后还是获得了大家的好评，渐渐的越来越多的多业务团队使用我开发的组件库。在团队中找到了自我价值，正式走起来了。个别高级别的同事还问我是不是真的工作不到一年。组长对我的工作也非常认可。</p><h2 id="绩效" tabindex="-1">绩效 <a class="header-anchor" href="#绩效" aria-label="Permalink to &quot;绩效&quot;">​</a></h2><p>开始接触到了绩效了，第一个季度拿了一次C，可能就是需要新人背一下绩效吧，开始感受职场API的残酷了，第三季度又是一个C，感觉自己变成背绩效的那一类人了。这个季度看到C的那一刹那，确实挺难受的，主动找身边的领导聊了一下。他分配了一个组件库的任务给我，希望我可以承担起来。</p><h2 id="入职" tabindex="-1">入职 <a class="header-anchor" href="#入职" aria-label="Permalink to &quot;入职&quot;">​</a></h2><p>一个人背着行李从武汉跑到苏州，签了和同程的三方，大概率是毕业以后也在这里了，作为实习生踏入职场，同事们都挺不错的，在组里我年龄最小，大家都对我挺照顾的，公司也提供了宿舍让我们住，免去了租房的烦恼，等以后也有公租房可以住，可以说在苏州的压力还是挺合适的，虽然没有很高的工资，但是还是生活的挺不错的，在这边的机票业务也是核心业务，也挺复杂的，很多东西也看不太懂，只有从最简单的东西入手了，刚来就做双旦营销活动，就加班到12点，心想有点恐怖。不过后面就好起来了，也分配了导师，会带我们学习。很多知识都不是很懂，就多花时间学习了。</p>',14),c=[d];function i(n,l,h,s,_,p){return o(),e("div",null,c)}const m=a(r,[["render",i]]);export{f as __pageData,m as default};
